function buildSalesByClient(parent) {

	if ($("#main").children("#c2") !== undefined) {
		$("#main").children("#c2").remove();
	}
	var div = $("<div id= 'c2' class='col-xs-12 col-md-6' style='padding:10px'><div id='chart12' class = 'panel panel-primary'>   " +
		"<div class = 'panel-heading'>Sales Per Client <button  type='button' class='close' onclick='closeSalesChart()' data-target='#chart12' data-dismiss='alert'> " +
		"        <span aria-hidden='true'>&times;</span><span class='sr-only'>Close</span></button></div><div class = 'panel-body' style='max-height: 60vh;overflow-y: scroll;'> <canvas id='salesByClient'></canvas>  </div>        </div></div>");
	div.appendTo(parent);
	$("#chart12").LoadingOverlay("show", { image: load_image, color: "rgba(255, 255, 255, 0)", zIndex: 2050 });

	var ffyear = $("#selectYr").val();
	$("#salesPer").draggable('disable');
	var ctx1 = document.getElementById("salesByClient");
	ctx1.width = 400;
	ctx1.height = 200;
	$.ajax({
		url: "graph/sales/client/" + ffyear,
		cache: false,
		dataType: 'JSON',
		success: function (response) {
			$("#chart12").LoadingOverlay("hide");

			console.log(response);

			var salesData = response.data;
			var salesDS = salesData.dataSets;

			var gendata = { 'labels': salesData['clientName'], 'datasets': [] };

			for (var i = 0; i < salesDS.length; i++) {
				var d = {};
				d.label = salesDS[i].label;
				d.data = salesDS[i].data;
				d.borderWidth = 1;
				d.backgroundColor = [];
				d.borderColor = [];
				for (var j = 0; j < d.data.length; j++) {
					d.backgroundColor.push(salesDS[i].bgColor);
					d.borderColor.push(salesDS[i].borderColor);
				}
				gendata.datasets.push(d);
			}

			var options = { scales: { yAxes: [{ ticks: { beginAtZero: true } }] } };

			var salesByClient = new Chart(ctx1, {
				type: 'bar',
				data: gendata,
				options: options
			});

		}
	});
}

