						var payReceived = item['payReceived'];
						var invdate = item['invoiceDate'];
						var date = null;
						if (Object.prototype.toString.call(invdate) === '[object Date]') {
							date = invdate;
						} else {
							date = new Date(invdate);
						}
						date.setDate(date.getDate() + value);
						var curDate = new Date();
						var amberDate = new Date();
						amberDate.setDate(amberDate.getDate() + 10);

						if (date < curDate && payReceived != true) {
							color = "#FFC9C9";
						} else if (date <= amberDate && payReceived != true) {
							color = "#FAE6AC";
						} else if (payReceived == true) {
							color = "#CFFFC9";
						} else {
							color = "#ffffff";
						}

						var month = date.getMonth() + 1;

