function diableItems(flag) {
	$("#deliveryNote").prop("readonly", flag);
	$("#destination").prop("readonly", flag);
	$("#po").prop("readonly", flag);
	$("#despatched").prop("readonly", flag);

	$("#deliveryOrderDate").prop("readonly", flag);
	$("#buyerOrderDate").prop("readonly", flag);
}

function clearItems() {
	$("#deliveryNote").val('');
	$("#destination").val('');
	$("#po").val('');
	$("#despatched").val('');

	$("#deliveryOrderDate").val('');
	$("#buyerOrderDate").val('');
}


function clearMonthlySalesTable() {
	
	$("#monthlyInvoiceBody").empty();
}

